import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
    return (
        <div className="expenses">
            {
                props.expensesItem.map(item =>
                    <ExpenseItem
                        title={item.title}
                        amount={item.amount}
                        date={item.date}
                    />
                )
            }
        </div>
    )
}

export default Expenses
